INSERT INTO `apprdocclientcontractevidence` VALUES (5,8,1,'エビデンス1','US001','2017-09-06 11:13:06','ApprDocEnt',NULL,NULL,NULL),(6,8,2,'エビデンス2\nエビデンス2','US001','2017-09-06 11:13:06','ApprDocEnt',NULL,NULL,NULL),(7,9,1,'エビデンス1エビデンス1エビデンス1エビデンス1エビデンス1エビデンス1エビデンス1','test','2017-09-06 17:02:22','ApprDocEnt',NULL,NULL,NULL),(8,11,1,'エビデンス1エビデンス1エビデンス1エビデンス1エビデンス1','test','2017-09-06 17:09:13','ApprDocEnt',NULL,NULL,NULL),(9,16,1,'エビデンス1','test','2017-09-06 19:26:58','ApprDocEnt','test','2017-09-06 19:26:58','Unknow'),(10,17,1,'っはあだｆｄｆｄさふぁｓｄふぁっさ','test','2017-09-06 19:42:38','ApprDocEnt','test','2017-09-06 19:42:38','Unknow'),(11,18,1,'','test','2017-09-06 19:55:18','ApprDocEnt','test','2017-09-06 19:55:18','Unknow'),(12,21,1,'エビデンス1','test','2017-09-07 12:16:28','ApprDocEnt','test','2017-09-07 12:16:28','Unknow'),(13,22,1,'エビデンス1','test','2017-09-11 16:02:18','ApprDocEnt','test','2017-09-11 16:02:18','Unknow'),(14,22,2,'エビデンス2','test','2017-09-11 16:02:18','ApprDocEnt','test','2017-09-11 16:02:18','Unknow'),(15,22,3,'エビデンス3','test','2017-09-11 16:02:18','ApprDocEnt','test','2017-09-11 16:02:18','Unknow'),(16,23,1,'','test','2017-09-11 20:48:01','ApprDocEnt','test','2017-09-11 20:48:01','Unknow'),(17,24,1,'','test','2017-09-19 20:21:03','ApprDocEnt','test','2017-09-19 20:21:03','Unknow'),(18,25,1,'','test','2017-09-19 20:31:10','ApprDocEnt','test','2017-09-19 20:31:10','Unknow'),(19,26,1,'dfafasd','test','2017-10-13 19:38:48','ApprDocEnt','test','2017-10-13 19:38:48','Unknow'),(20,27,1,'見積書を添付いたします。見170822001','000009','2018-01-17 15:15:45','ApprDocEnt','000009','2018-01-17 15:15:45','Unknow'),(22,28,1,'=========================================\n□案件名：大手代理店のWEBサイト制作\n□期間：平成29年10月25日～平成29年11月30日\n　※長期（3ヵ月更新※初回のみ1ヵ月契約）\n□作業場所：客先指定場所\n□沿線/最寄駅：九段下駅\n□勤務時間：10：00～19：00\n□作業範囲：webデザイナー\n□月額単金：560,000円\n□精算方法：時間幅：140-180\n□超過単金：3,111円【180割り】※小数点以下切捨て\n□控除単金：4,000円【140割り】※小数点以下切捨て\n□調整単位：30分\n□支払条件：毎月末日締め翌月末日支払い（30日サイト）\n\n◇ただし、10月分は下記の通りに日割り計算とする。\n　2017年10月25日～2017年10月31日\n\n10月の基本単価：560,000円÷21日×5日＝133,333円\n□超過単価： 3,111円（42h）\n□控除単価：-4,000円（33h）\n=============================================\n※入場詳細、勤怠表のフローなど、\n　分かり次第、再度ご連絡いたします。\n\n以上\n何卒宜しくお願い致します。','000010','2018-01-17 16:14:28','ApprDocUpd','000010','2018-01-17 16:14:28','Unknow'),(25,29,1,'TSRソリューションズ株式会社\n 田口　麻衣子様\n\nいつも大変お世話になっております。\nSky株式会社の内海でございます。\n\n島田様のご契約詳細は下記の通りです。\nご確認の程、宜しくお願い致します。\n\n※基本契約書に関して、2016年3月31日で締結させて頂きます。\n※雇用保険被保険者証の控えを本メールへご返信ください。\n\n　・期間：2016年04月01日～2016年06月30日\n　※7月以降に関しては、5月末までにご連絡させて頂きます。\n　・作業場所：パイオニア 川越事業所\n　・ご単金：\\4,500/1h\n　※小数点以下は切り捨てさせて頂きます.\n　・清算単位：15分\n　・締め支払い：毎月末日締め、翌々月5日支払い\n\n初日の入場方法については、別途ご連絡させて頂きます。\n\n以上、何卒宜しくお願い致します。','000008','2018-01-17 17:37:58','ApprDocUpd','000008','2018-01-17 17:37:58','Unknow'),(26,29,2,'【T社17CY開発業務のプロジェクトリーダ業務】\n・オフショア先の管理\n　オフショア先(中国)のPLと連絡を取りながら、プロジェクト\n　全体の推進を図る。\n\n・バグトラッキング\n　バグの発生状況、評価の進捗を見ながら、SAバグ0、バグ0の\n　マイルストーンに向けての収束状況を把握、コントロールする\n\n・機材管理\n　開発に使用する機材の管理・調整、配布\n\n・開発環境検討\n　マスターデータ管理、組み合わせるソフトの検討等\n　\n・他部署との調整\n　設計、生産技術、生産管理との各種調整','000008','2018-01-17 17:37:58','ApprDocUpd','000008','2018-01-17 17:37:58','Unknow'),(28,30,1,'','000008','2018-01-17 18:07:56','ApprDocUpd','000008','2018-01-17 18:07:56','Unknow'),(31,31,1,'見積書を添付いたします。見171027002','000010','2018-01-17 18:46:53','ApprDocUpd','000010','2018-01-17 18:46:53','Unknow'),(32,32,1,'On 2016/08/30 16:00, シービーエス佐竹 wrote:\n> TSRソリューションズ株式会社\n> 吉田様\n>\n> いつもお世話になっております。\n> シービーエスの佐竹です。\n>\n> 昨日、本日と東潟様の件、様々御調整下さり誠にありがとうございます。\n> 東潟様の御契約詳細につきまして送らせて頂きますので、\n> 御確認頂けましたら御返信の程、よろしくお願い申し上げます。\n>\n> 別途、9/1入場時に必要な書類を送らせて頂きますので、\n> 東潟様にも御共有の程、よろしくお願い申し上げます。\n>\n> 【東潟様　御契約詳細】\n> 単価：540,000円/月\n> 精算：140H-180H(上下割り、15分単位、1円単位切捨て)\n> 超過：3,000円/時間\n> 控除：3,850円/時間\n> 支払いサイト：月末締め翌々月15日（45日サイト）\n> 　※金融機関休祝日の場合、翌営業日お振込み\n> 契約形態：業務委託契約\n> 契約単位：2016年9月1日～9月30日　単月更新\n> 　　　　　（その後問題無ければ3ヶ月更新となります）','000003','2018-01-17 20:02:59','ApprDocEnt','000003','2018-01-17 20:02:59','Unknow'),(33,32,2,'>\n> ＜案件情報＞\n> 【案 件 名】　Excel VBAによる維持管理業務（マクロ、ツール作成）\n> 【作業期間】　2016年9月～来年3月予定(延長可能性有り)\n> 【作業場所】　品川シーサイド徒歩5分\n> 【作業内容】\n> 銀行様で使用されているツールの品質管理プロジェクトにおいて、\n> csvファイルの抽出、加工等を、ExcelVBA(主にマクロ)を用いて行います。\n> バリバリ開発というよりは維持管理・維持保守的な業務が主となります。\n>\n> 【作業工程】　詳細設計～結合テスト\n> 【スキル要件】\n> ・Excel VBA製造経験 （マクロ、ツール作成可能で手が動く方）\n> ・入場後のキャッチアップ（リーダーとのコミュニケーション）に問題無い\n方\n>\n> 【想定単価】　MAX55万/月(スキル見合い)\n> 　　　　　　　精算：140-180H\n> 【面談回数】　1回（品川シーサイドにて）\n> 【募集人数】　1名\n> 【そ　の　他】\n> ・外国籍不可\n> ・別プロジェクトにて1名参画中\n> ・8/29(月)夕方（17時以降）面談予定\n>  ※上記含め、対応可能日を2,3頂けると幸いです。\n> ＝＝＝＝＝','000003','2018-01-17 20:02:59','ApprDocEnt','000003','2018-01-17 20:02:59','Unknow'),(34,33,1,'見積書を添付いたします。見171027001','000003','2018-01-18 09:35:28','ApprDocEnt','000003','2018-01-18 09:35:28','Unknow'),(35,34,1,'眞如様\n\nいつもお世話になっております。\nエルバーラ・スイス　菊地です。\n\nご返信が遅くなり大変失礼致しました。\n\n商流につきましては以下になります。\n\n　エンド⇒元請⇒上位⇒弊社⇒貴社\n\nまた、条件面につきまして以下に記載させて頂きますので\nご確認の程よろしくお願い致します。\n\n【契約条件】\n-----------------------------------------------------------\n期間：10月～長期\n単価：500,000円\n精算幅：150h-200h  上下割り\n超過額：2,500円\n控除額：3,330円 （10円未満切り捨て）\n精算時間単位：30分毎\n勤務時間：9：00～18：00\nサイト：月末締め45日\n-----------------------------------------------------------','test','2018-01-18 10:10:19','ApprDocEnt','test','2018-01-18 10:10:19','Unknow'),(48,43,1,'\"> 2017年7月4日 13:49 キャスレー/小暮　翔\n> <sho.kogure@casleyconsulting.co.jp\n> <mailto:sho.kogure@casleyconsulting.co.jp>>:\n> \n>     須賀様\n> \n>     キャスレー小暮でございます。\n> \n>     本件、正式内容にて再送致しますので、\n>     ご確認頂けますと幸いでございます。\n>      \n>     案件名：   \n>     追加）→AD/ADFS/WSUS技術支援\n>                                \n>     期　間：2017年7月18日　～　※7のみ単月、以降3ヶ月更新\n>     追加）→すみません、7/18~9/30,以降3ヶ月更新とさせてください。\n>      \n>     入　場：2017年7月18日（火）\n>      \n>     単　価：7月のみ：65万＊10稼働日/20営業日＝32.5万\n>     　　　　8月以降：65万\n>      \n>     氏　名：加藤　恭之　(カトウ　ヤスユキ)\n>      \n>     時間幅：140-180　※上下割・中割などございましたら、ご教授下さいませ。\n>     追加）→7月は50％の稼働ですので、\n>     　　　　上下割で70-90ｈの基準時間とします。\n>      \n>     勤務地：新横浜\n>     追加）→基本は面談したFST本社です。\n>     　　　　ただし、構築時など現地作業の場合は都内近郊のお客様先に行く場\n>     合がございます。\n>      \n>     時間単位：30分単位\n>      \n>     支払いサイト：毎月末日〆翌々月15日払い　(45日サイト)\n> \n>     以上になります。\n> \n>     引き続き、何卒よろしくお願いいたします。\n\"																\n																\n																\n																\n																\n','000010','2018-01-22 12:03:24','ApprDocEnt','000010','2018-01-22 12:03:24','Unknow'),(49,43,2,'\"On 2017/07/05 18:13, キャスレー/小暮　翔 wrote:\n> 須賀様\n> \n> キャスレー小暮でございます。\n> \n> お電話にてお話させて頂いた内容になります。\n> \n> 精算：上下割（140ー180）\n> 商流：エンド→元請け→キャスレー\n> 　　　※ただし上位同士が業務委託にて契約のため、\n> 　　　　案件の決済権としてはエンド→キャスレー\n> \n> 以上になります。\n> \n> 引き続き、何卒よろしくお願いいたします。\n> \"														\n														\n														\n														\n														\n','000010','2018-01-22 12:03:24','ApprDocEnt','000010','2018-01-22 12:03:24','Unknow'),(51,45,1,'\"On 2016/10/14 12:04, 飯島民夫 wrote:\n> 中村様\n> \n> お世話になります。飯島です。\n> 色々とご尽力いただき有難うございます。\n> \n> ご依頼の件、下記致します。\n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> □案件名（書面上の正式名称）：航空管制システム改修・テスト業務\n> □期間：（書面上での契約期間）2016.10.○○～2016.11.30（※一旦この期間で問題\n> が無ければ12月～）\n> □入場日：平成28年10月19日\n> □作業場所：221-0056 神奈川県横浜市神奈川区金港町３－１　コンカード横浜１７Ｆ\n> □沿線/最寄駅：横浜\n> □作業範囲：システム改修～テスト業務\n> □担当：山本\n> □月額単金（税抜）：￥520,000-\n> □精算方法：140h-180h\n> □超過単金：\\2,600-【200割り】＊1円未満（切捨て）\n> □控除単金：\\3,710-【140割り】＊1円未満（切捨て）\n> □就業時間：9:00～17:45\n> □休憩時間：12:00～12:45\n> □調整単位：超過控除30分単位\n> □契約形態：請負\n> □支払条件：毎月末締翌末支払\n> □10月の精算方法：調整中です（日割按分になる可能性が高いです）\n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\"																\n																\n																\n																\n																\n','000004','2018-01-22 13:30:08','ApprDocEnt','000004','2018-01-22 13:30:08','Unknow'),(66,57,1,'\"＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n契約形態：派遣\n□案件名（書面上の正式名称）：複合機開発業務\n□期間：（書面上での契約期間）6/19～9/30\n□作業場所：神奈川県厚木市栄町1-7-16富士ソフト厚木オフィスビル5F\n□沿線/最寄駅：小田急線　本厚木駅\n□勤務時間：9:00～17:30\n□作業範囲：設計、製造、テスト\n□担当：プログラマー\n□月額単金：550,000円\n□精算方法：時間幅140h-180h\n□超過単金：3,055円【180割り】＊1円未満（切捨て）\n□控除単金：3,928円【140割り】＊1円未満（切捨て）\n□調整単位：10分単位\n□支払条件：毎月末日締め翌月末日支払い\n□6月の精算方法：日割按分精算とします。\n\\550,000×10日(稼動日)/22日(営業日)⇒\\250,000(10円未満切捨て)\n基準時間：70H-90H　調整単価:変更なし\n\n\"																\n																\n																\n																\n																\n','000003','2018-01-22 18:01:47','ApprDocEnt','000003','2018-01-22 18:01:47','Unknow'),(67,58,1,'\"\n\nＴＳＲソリューションズ\n劉巍様\n\nいつもお世話になっております。\nアジアンリンクの林です\n\n発注期間でございますが、顧客が単月更新のため\nまずは11月末となります。\n12月分はすぐに発注できると思います。\n※案件は2月末までございます。\n\n***************************************************\n\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n□案件名（書面上の正式名称）：ソフトウェアの展開作業\n●□期間：（書面上での契約期間）：11月16日～単月更新（初回11月末、2月末まで延長あります。）\n●□作業場所：田町\n※主に田町で作業するが、偶に横浜に行くかもしれません。\n横浜に作業になるとき、田町（主現場）から横浜までの交通費ご請求お願いいたします。\n\n●□沿線/最寄駅：田町駅\n□勤務時間：21：00～8：00（夜間のみ）\n毎週、日、月、火、水、木の5日間\n　　　　以上は基本的な勤務時間となります。\n※11/16～11/24まで　9：00～18：00はOJTの研修となります。\n□作業範囲：\n\"																\n																\n																\n																\n																\n','000004','2018-01-22 18:12:18','ApprDocEnt','000004','2018-01-22 18:12:18','Unknow'),(68,58,2,'\"\n□月額単金：440,000円 □精算方法：時間幅：\n●□超過単金：2,200円【200割り】＊10円未満（切捨て）\n●□控除単金：3,140円【140割り】＊10円未満（切捨て）\n□調整単位：30　分\n□支払条件：毎月末日締め翌々月末15日（45日サイト）\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n\n\n以上\n宜しくお願い致します。\"														\n														\n														\n														\n														\n','000004','2018-01-22 18:12:18','ApprDocEnt','000004','2018-01-22 18:12:18','Unknow'),(73,63,1,'見積り番号：見170930003を添付いたします。','000003','2018-01-23 09:24:35','ApprDocEnt','000003','2018-01-23 09:24:35','Unknow'),(75,65,1,'\"On 2017/03/21 19:33, 桧垣健一 wrote:\n> TSRソリューションズ\n> 吉田様\n> \n> いつも大変お世話になっております。\n> フロイントの桧垣です。\n> 標記の件、下記の通り御見積書のご準備をお願いします。\n> ※長期予定のプロジェクトですが、契約単位は単月となってしまいます。\n> 【件名】\n> 通信事業者向け共通プラットフォーム開発（2017年度4月）\n> 【作業内容】\n> 上記プロジェクトの設計・製造・試験支援作業\n> 【期間】\n> 2017年4月1日　～　2017年4月30日\n> 【単価】\n> 沈様　　：　770,000円／人月\n> 山本様 ：　720,000円／人月\n> 【契約形態】\n> 準委任契約\n> 【作業場所】\n> 弊社指定場所\n> 【納入物件】\n> 作業報告書、業務完了報告書\n> 【納入場所】\n> 弊社指定場所\n> 【納入期限】\n> 平成29年11月30日\n> 【支払い条件】\n> 月末締め翌々月15日支払い\n> 【清算条件】\n> 単価固定\n> ※200H以内に納まるように稼働調整を行います。\n\"																\n																\n																\n																\n																\n','000003','2018-01-23 11:17:35','ApprDocEnt','000003','2018-01-23 11:17:35','Unknow'),(76,65,2,'\"　\n【プロジェクト名】\nBizダイヤル保守開発\n\n【概要】\n某通信業者での法人向けサービスのアプリ基盤保守開発\n↓こちらを参照ください。\nhttp://www.softbank.jp/biz/mobile/fmc/solution/bizdial/\n\n【作業場所】\n勝どき\n\n【参画時期、募集人数】\n４月～、２名（リーダ１名＋プログラマ１名）\n\n【必要スキル】\n・Java、Javascript、Linux、SQL、Ｊｕｎｉｔ\n・リーダー：若手２名への作業指示と技術支援、顧客調整、管理、実装を担当して頂きます。\n・プログラマ：リーダー指示のもと、設計、開発、テストを担当して頂きます。\n\n【清算条件】\n基本的には、人月固定\n※200Ｈを超えることは実績的にはなさそうです。\n　基本的には、稼働を抑える方向で調整する現場となります。 \"														\n														\n														\n														\n														\n','000003','2018-01-23 11:17:35','ApprDocEnt','000003','2018-01-23 11:17:35','Unknow'),(84,70,1,'\"\nOn 2017/06/29 11:11, 飯田純一 wrote:\n> 吉田様\n> \n> お世話になっております。\n> ファングラーテクノロジー飯田でございます。\n> \n> 先ほどはお電話で有難うございました。\n> 取り急ぎ作成いたしました契約条件をお送りさせて頂きます。\n> ※注文書は申し訳ございませんが、少々お待ち頂ればと思います。\n> \n> --------------ご契約条件--------------------\n> 【案件名】：証券システム開発支援\n> 【業務内容】：調査～テスト（システム開発に伴う一連の作業）\n> 【氏　名】：佐藤　昌明様\n> 【期　間】：2017/7/1～7/31※初回契約\n> 【場　所】：元請社外神田開発センター\n> 【提出物】：弊社作業報告書\n> 【単　金】：\\700,000\n> 【時　間】：9：00～17：30\n> 【精　算】：140-200（※7月は契約初月の為固定）\n> 【精算単価】：超過単価￥3,500／控除単価￥5,000\n> 【精算単位】：0.5Ｈ\n> 【サイト】：45日サイト（月末締め翌々月15日払い）\n> ----------------------------------------------\"																\n																\n																\n																\n																\n','000002','2018-01-23 13:14:03','ApprDocEnt','000002','2018-01-23 13:14:03','Unknow'),(85,70,2,'\"案件：楽天証券向けの持ち帰り案件\n\n場所：秋葉原\n\n担当部分：基幹バッチ（C++ Oracle11g）\n　　　　　画面側開発（VB6 or VB.net）\n\n工程：基本設計～開発、テスト、リリース\n\n人数等：案件を常に5,6個回しながら、20～30人程度にて開発を\n　　　　行っている\n　　　　リリースが毎月あるので、頻度は低いですが夜間や\n　　　　休日作業もあり（振休取得有）\n\n備考：持ち帰り案件で従事させて楽天向けのノウハウをためて、\n　　　素養がある、やる気のある方は社員代替として二子玉川\n　　　へ参画させるスキームとの事です。 \"														\n														\n														\n														\n														\n','000002','2018-01-23 13:14:03','ApprDocEnt','000002','2018-01-23 13:14:03','Unknow'),(86,71,1,'\"On 2017/11/27 18:00, 営業＠トレックス wrote:\n> ＴＳＲソリューションズ株式会社\n> 劉様\n> \n> いつもお世話になっております。\n> トレックスのフでございます。\n> \n> 先ほど、電話でご連絡して頂きました通り、\n> 下記通りの内容をお知らせさせていただきます。\n> \n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> □案件名（書面上の正式名称）：某生命保険向けシステム開発支援\n> □期間：（書面上での契約期間）：12月1日～3月31日(延長可能有)\n> □作業場所：蒲田客先\n> □沿線/最寄駅：蒲田駅