算\n> □精算方法：140時間～180時間\n> □超過単金：3,312円（1円未満切り捨て）\n> □控除単金：3,312円（1円未満切り捨て）\n> □就業時間：8:00～17:00\n> □休憩時間：11:45～12:45（業務状況により変動の可能性あり）\n> □調整単位：15分\n> □契約形態：業務委託（準委任契約）\n> □支払条件：月末締め翌々月5日振込（35日サイト）\n> 　　　　　　※振込日が休日の場合には、前営業日振込\n> □商流：お客様　→　弊社　→TSRS\"																\n																\n																\n																\n																\n','000010','2018-01-26 10:29:36','ApprDocEnt','000010','2018-01-26 10:29:36','Unknow'),(191,135,1,'\nＴＳＲソリューションズ\n劉巍様\n\nいつもお世話になっております。\nアジアンリンクの林です\n\n発注期間でございますが、顧客が単月更新のため\nまずは11月末となります。\n12月分はすぐに発注できると思います。\n※案件は2月末までございます。\n\n***************************************************\n\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n□案件名（書面上の正式名称）：ソフトウェアの展開作業\n●□期間：（書面上での契約期間）：11月16日～単月更新（初回11月末、2月末まで延長あります。）\n●□作業場所：田町\n※主に田町で作業するが、偶に横浜に行くかもしれません。\n横浜に作業になるとき、田町（主現場）から横浜までの交通費ご請求お願いいたします。\n\n●□沿線/最寄駅：田町駅\n□勤務時間：21：00～8：00（夜間のみ）\n毎週、日、月、火、水、木の5日間\n　　　　以上は基本的な勤務時間となります。\n※11/16～11/24まで　9：00～18：00はOJTの研修となります。\n□作業範囲：','000004','2018-01-26 13:32:18','ApprDocEnt','000004','2018-01-26 13:32:18','Unknow'),(192,135,2,'□月額単金：440,000円 □精算方法：時間幅：\n●□超過単金：2,200円【200割り】＊10円未満（切捨て）\n●□控除単金：3,140円【140割り】＊10円未満（切捨て）\n□調整単位：30　分\n□支払条件：毎月末日締め翌々月末15日（45日サイト）\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n\n\n以上\n宜しくお願い致します。','000004','2018-01-26 13:32:18','ApprDocEnt','000004','2018-01-26 13:32:18','Unknow'),(201,138,1,'\"TSRソリューションズ　戸川様\n\nいつもお世話になっております。\nハイマックスの国貞です。\n\nこの度は大変お待たせしてしまい\n申し訳ありません。\n\n以下に情報を記載しています。\n精算方法等については、日割りにしていただいて結構です。\n\nよろしくお願いいたします。\n\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n□案件名（書面上の正式名称）：クレジット会社向け次世代基幹システム構築支援\n□期間（書面上での契約期間）：お手数ですが1ヶ月単位でお願いします\n□作業場所：東京都新宿区西新宿8丁目17番1号 (TIS株式会社本社内）\n□沿線/最寄駅：西新宿駅\n□勤務時間：9:00～17:45\n□作業範囲：周辺移行チームのテスト計画および作業管理/推進\n□担当：テスト計画および作業管理/推進\n□月額単金：870,000円\n□精算方法：時間幅140h-200h\n□超過単金：4,350円【200割り】＊1円未満（切捨て）\n□控除単金：6,210円【140割り】＊1円未満（切捨て）\n□調整単位：30分\n□支払条件：毎月末日締め翌月末日支払い（30日サイト）\n□7月の精算方法：日割按分精算とします。 \"																\n																\n																\n																\n																\n','000003','2018-01-26 15:23:55','ApprDocEnt','000003','2018-01-26 15:23:55','Unknow'),(217,145,1,'\"On 2017/03/21 19:33, 桧垣健一 wrote:\n> TSRソリューションズ\n> 吉田様\n> \n> いつも大変お世話になっております。\n> フロイントの桧垣です。\n> 標記の件、下記の通り御見積書のご準備をお願いします。\n> ※長期予定のプロジェクトですが、契約単位は単月となってしまいます。\n> 【件名】\n> 通信事業者向け共通プラットフォーム開発（2017年度4月）\n> 【作業内容】\n> 上記プロジェクトの設計・製造・試験支援作業\n> 【期間】\n> 2017年4月1日　～　2017年4月30日\n> 【単価】\n> 沈様　　：　770,000円／人月\n> 山本様 ：　720,000円／人月\n> 【契約形態】\n> 準委任契約\n> 【作業場所】\n> 弊社指定場所\n> 【納入物件】\n> 作業報告書、業務完了報告書\n> 【納入場所】\n> 弊社指定場所\n> 【納入期限】\n> 平成29年11月30日\n> 【支払い条件】\n> 月末締め翌々月15日支払い\n> 【清算条件】\n> 単価固定\n> ※200H以内に納まるように稼働調整を行います。\n\"																\n																\n																\n																\n																\n','000004','2018-01-26 16:22:19','ApprDocUpd','000004','2018-01-26 16:22:19','Unknow'),(218,145,2,'\"　\n【プロジェクト名】\nBizダイヤル保守開発\n\n【概要】\n某通信業者での法人向けサービスのアプリ基盤保守開発\n↓こちらを参照ください。\nhttp://www.softbank.jp/biz/mobile/fmc/solution/bizdial/\n\n【作業場所】\n勝どき\n\n【参画時期、募集人数】\n４月～、２名（リーダ１名＋プログラマ１名）\n\n【必要スキル】\n・Java、Javascript、Linux、SQL、Ｊｕｎｉｔ\n・リーダー：若手２名への作業指示と技術支援、顧客調整、管理、実装を担当して頂きます。\n・プログラマ：リーダー指示のもと、設計、開発、テストを担当して頂きます。\n\n【清算条件】\n基本的には、人月固定\n※200Ｈを超えることは実績的にはなさそうです。\n　基本的には、稼働を抑える方向で調整する現場となります。 \"														\n														\n														\n														\n														\n','000004','2018-01-26 16:22:19','ApprDocUpd','000004','2018-01-26 16:22:19','Unknow'),(219,147,1,'\"On 2017/05/02 9:44, Ando wrote:\n> TSRソリューションズ\n> 新井　様\n> ＩＣＣ　安藤です。\n> いつも大変お世話になっております。\n> ５／１０より入場を頂く要員(五十嵐様)の発注条件につきまして\n> 下記のご質問に回答させて頂くます。\n> 稼働時間数が契約の１６０時間を下回る月につきましては\n> 現場運用で１６０時間を割らないよう業務量(時間数)を調整する\n> 事になっております。\n> 同案件の他社様に対する発注もそのようになっております。\n> ご了解ください。\n> よろしくお願い致します。\n> -----Original Message-----\n> From: 新井　典孝 [mailto:noritaka.arai@tsrs.co.jp]\n> Sent: Tuesday, May 2, 2017 9:36 AM\n> To: andoh_icc@softbank.ne.jp; andoh@iccjapan.co.jp\n> Cc: TSRソリューションズ吉田様\n> Subject: TSRS新井です\n> On 2017/05/01 18:26, 新井　典孝 wrote:\n>> On 2017/05/01 17:57, 【TSRS】吉田　隆一 wrote:\n>>> -------- Forwarded Message --------\n>>> Date: Mon, 01 May 2017 17:37:31 +0900\n>>> From: To: ryuichi.yoshida@tsrs.c