						\n																\n','000004','2018-01-26 16:55:44','ApprDocEnt','000004','2018-01-26 16:55:44','Unknow'),(243,161,1,'\"To：TSRソリューションズ　劉様\nCc：TSRソリューションズ　李様\n   　張さん\n\nJCソフトの趙です。\nいつもお世話になっております。\n\n昨日お越しいただき、どうもありがとうございます。\n下記でお願いできないでしょうか。\n\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n□案件名（書面上の正式名称）：OMNI運用・開発支援\n　対象ECサイト：http://www.omni7.jp/top/\n□期間：（書面上での契約期間）：平成29年2月１日～2月28日\n　一旦開発Tと同様に1か月毎契約するが、運用サポートがメインなので、\n　客先と長期契約に切り替えるよう相談する予定。\n□作業場所：東京都千代田区麹町4-3-3新麹町ビル（現在）\n　東京都千代田区一番町８住友不動産一番町ビル（2月以降）\n　※過去2年間PJ体制の増減により、エンドユーザの周りで何回か引っ越しているが、\n　　下記通勤駅から10分以内で歩ける距離。\n　　万が一通勤駅まで変更する場合、事前に連絡します。\n□沿線/最寄駅：有楽町線麹町駅、半蔵門線半蔵門駅、JR四ツ谷駅\n□勤務時間：通常09:00～18:00、現在本番後対応中の為、\n　シフト無し：10:00～18:00、日中：10:00～22:00、夜間：22:00～10:00\n　日中か夜間のシフトは2、3回/月有（夜勤の場合当日・翌日休、土日の場合代休）\n　運用サポート夜間対応専任につき、22:00～8:00（調整する可能性有）\n□作業範囲：ECサイトの運用・開発支援\n□月額単金：450,000円\n□精算方法：時間幅140～200\n□超過単金：2250円【200割り】＊1円未満（切捨て）\n□控除単金：3214円【140割り】＊1円未満（切捨て）\n□調整単位：30分\n□支払条件：毎月末日締め翌月末日支払い（30日サイト）\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n\n作業時間をご希望の140～180から140～200へ御調整いただければありがたいです。\n実態としてリーダクラス以外、170時間を超えることはあまりありません。\nぎりぎり200時間まで作業させられる心配はありません。\nまた、200時間まで行かなくても、残業したら代休を取っていただいてOKです。\n（当たり前のことですが）\n\nまた、昨日簡単に説明した件ですが、\n開発Tの中の運用Tということで、お作法はやりながら確定する形になりますので、\n多少今の話と変わることが出てくる可能性もあるので、\nその時、話し合って調整していきましょう。\n3月の時、弊社提案通りにさらに増員する可能性も大きいので、\n相応しい要員がいたら、ご留意いただければ助かります。\n\n以上、よろしくお願いいたします。\n\n------Original Message------\n送信元：\"\"劉　巍\"\"<wei.ryu@tsrs.co.jp>\n送信先：<senyou.chou@jcsoft.jp>\nＣＣ：<koichi.togawa@tsrs.co.jp>,<kaito.lee@tsrs.co.jp>\n件名：[TSRS] 　条件面について\n送信日時：2017年01月17日 10:26:41(+0900)\"																\n																\n																\n																\n																\n','000016','2018-01-26 18:25:21','ApprDocEnt','000016','2018-01-26 18:25:21','Unknow'),(246,162,1,'見積書を添付いたします。見171027002																\n																\n																\n																\n																\n','000008','2018-01-26 18:54:35','ApprDocEnt','000008','2018-01-26 18:54:35','Unknow'),(252,166,1,'\" 劉さん\n\nお世話になります。飯島です。\n下記案件概要になります。\n黄さんのフルネ－ム（漢字とフリガナ）を早めに頂けますでしょうか？\n\n【業務内容】公共システム製造～テスト案件業務(Java/Oracle)\n【勤務地】東京都千代田区神田神保町3-25 住友不動産住友神保町ビル\n【エンド】(株)日立システムズ\n【勤務時間】9～1730（12～1245）\n【勤務表】２種類（日立システム用＋請求確認用）\n※請求確認用は御社フォームで構いませんが一旦フォーム雛型を頂けます（メール）と助かります。\n\n【契約期間】７月６日（予定※調整中）～１２月末予定（原則１ヶ月単位）※７、８月については２ヶ月精算の可能性有\n【契約単価】４６万円（税抜）※７月は途中入場なので営業日割計算。\n【精算範囲】１４０～２００H※精算単価上下限時間割\n【定時内カウント単位】１５分単位\n【定時外カウント単位】３０分単位（17:30から17:45、19:00から19:30、21:30から21:45、23:45から0:15は休憩時間となりカウントされませんのでお気をつけください。）\n【備考】日本語コミュニケーションや業務スキルにて著しく業務支障が生じる場合は要員交代・終了も含め速やかに相談対応願います。\n【契約先】LEX(株)\n\n宜しくお願い致します。\n\"																\n																\n																\n																\n																\n','000004','2018-01-26 19:48:23','ApprDocEnt','000004','2018-01-26 19:48:23','Unknow'),(255,169,1,'','000003','2018-01-26 20:16:04','ApprDocEnt','000003','2018-01-26 20:16:04','Unknow'),(266,51,1,'見積書を添付いたします','000003','2018-01-29 10:38:33','ApprDocUpd','000003','2018-01-29 10:38:33','Unknow'),(267,177,1,'見積書を添付いたします','000003','2018-01-29 10:38:51','ApprDocEnt','000003','2018-01-29 10:38:51','Unknow'),(272,139,1,'\"On 2017/01/30 20:20, AZURE・PLUS 小川大輔 wrote:\n> TSRソリューションズ\n> 中村様\n> \n> お世話になっております。\n> アズールプラス小川でございます。\n> \n> 返信が遅くなってしまい申し訳ございません。\n> \n>> まずはご契約の件、下記にフォーマットを添付いたしますので、\n>> 現時点でわかる範囲で構いません、詳細条件をお知らせいただけますと\n>> 幸いです。\n> \n> 詳細を記入致しましたのでご確認お願い致します。\n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> □案件名（書面上の正式名称）：GWコントローラファームウェア開発業務\n> □期間（書面上での契約期間）：2017年2月1日～3月31日\n> □入場日：2017年2月1日\n> □作業場所：リコーテクノロジーセンター\n> □沿線/最寄駅：海老名駅\n> □作業範囲：設計、開発、テスト、開発環境構築、ドキュメント作成、問い合わせ対応 等\n> □作業担当：メンバー\n> □月額単金（税抜）：550,000円\n> □精算方法：140h-180h（上下割）\n> □超過単金：3,050円/h　※10円未満切り捨て\n> □控除単金：3,920円/h　※10円未満切り捨て　\n> □就業時間：（3月まで）9:30-18:30\n> 　　　　　　（4月以降）9:00-18:00\n> □休憩時間：1時間\n> □調整単位：30分単位\n> □契約形態：SES契約\n> □支払条件：月末締め、翌々月10日払い（40日サイト）\n> □2月の精算方法：通常通り\n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> \"																\n																\n																\n																\n																\n','000010','2018-01-29 11:05:24','ApprDocUpd','000010','2018-01-29 11:05:24','Unknow'),(281,182,1,'TSRソリューションズ　戸川様\n\nお世話になっております。\nDTS長嶋です。\n\nご質