：時間幅：150H-200H\n> □超過単金：2,650円【200割り】＊1円未満（切捨て）\n> □控除単金：3,533円【150割り】＊1円未満（切捨て）\n> □調整単位：　30分\n> □支払条件：毎月末日締め翌々月15（45日サイト）\n> \n> ◇ただし、12月分は下記の通りに日割り計算とする。\n> 　2017年12月13日～2017年12月31日\n> \n> 12月の基本単価：稼働数÷総稼働数×月額単価＝12÷20×530,000＝318,000円\n> □超過単価：2,650円（120h）\n> □控除単価：-3,533円（90h）\n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> 以上、宜しくお願い致します。\n> \"																\n																\n																\n																\n																\n','000004','2018-01-29 16:36:55','ApprDocEnt','000004','2018-01-29 16:36:55','Unknow'),(315,201,1,'\"To：TSRソリューションズ　劉様\nCc：TSRソリューションズ　李様\n   　張さん\n\nJCソフトの趙です。\nいつもお世話になっております。\n\n昨日お越しいただき、どうもありがとうございます。\n下記でお願いできないでしょうか。\n\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n□案件名（書面上の正式名称）：OMNI運用・開発支援\n　対象ECサイト：http://www.omni7.jp/top/\n□期間：（書面上での契約期間）：平成29年2月１日～2月28日\n　一旦開発Tと同様に1か月毎契約するが、運用サポートがメインなので、\n　客先と長期契約に切り替えるよう相談する予定。\n□作業場所：東京都千代田区麹町4-3-3新麹町ビル（現在）\n　東京都千代田区一番町８住友不動産一番町ビル（2月以降）\n　※過去2年間PJ体制の増減により、エンドユーザの周りで何回か引っ越しているが、\n　　下記通勤駅から10分以内で歩ける距離。\n　　万が一通勤駅まで変更する場合、事前に連絡します。\n□沿線/最寄駅：有楽町線麹町駅、半蔵門線半蔵門駅、JR四ツ谷駅\n□勤務時間：通常09:00～18:00、現在本番後対応中の為、\n　シフト無し：10:00～18:00、日中：10:00～22:00、夜間：22:00～10:00\n　日中か夜間のシフトは2、3回/月有（夜勤の場合当日・翌日休、土日の場合代休）\n　運用サポート夜間対応専任につき、22:00～8:00（調整する可能性有）\n□作業範囲：ECサイトの運用・開発支援\n□月額単金：450,000円\n□精算方法：時間幅140～200\n□超過単金：2250円【200割り】＊1円未満（切捨て）\n□控除単金：3214円【140割り】＊1円未満（切捨て）\n□調整単位：30分\n□支払条件：毎月末日締め翌月末日支払い（30日サイト）\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n\n作業時間をご希望の140～180から140～200へ御調整いただければありがたいです。\n実態としてリーダクラス以外、170時間を超えることはあまりありません。\nぎりぎり200時間まで作業させられる心配はありません。\nまた、200時間まで行かなくても、残業したら代休を取っていただいてOKです。\n（当たり前のことですが）\n\nまた、昨日簡単に説明した件ですが、\n開発Tの中の運用Tということで、お作法はやりながら確定する形になりますので、\n多少今の話と変わることが出てくる可能性もあるので、\nその時、話し合って調整していきましょう。\n3月の時、弊社提案通りにさらに増員する可能性も大きいので、\n相応しい要員がいたら、ご留意いただければ助かります。\n\n以上、よろしくお願いいたします。\n\n------Original Message------\n送信元：\"\"劉　巍\"\"<wei.ryu@tsrs.co.jp>\n送信先：<senyou.chou@jcsoft.jp>\nＣＣ：<koichi.togawa@tsrs.co.jp>,<kaito.lee@tsrs.co.jp>\n件名：[TSRS] 　条件面について\n送信日時：2017年01月17日 10:26:41(+0900)\"																\n																\n																\n																\n																\n','000001','2018-01-29 17:15:33','ApprDocEnt','000001','2018-01-29 17:15:33','Unknow'),(316,202,1,'\"On 2017/11/29 17:04, XIAOWEN WANG wrote:\n> ＴＳＲソリューションズ\n> 劉　様\n> \n> いつもお世話になっております。\n> イー・ビジネス営業の王でございます。\n> \n> 下記の記入完了致しました。\n> ご査収の程宜しくお願い致します。\n> \n> ※弊社のパートナー情報確認書に口座のご記入お願いします。\n> \n> 以上、宜しく申し上げます。\n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> □案件名（書面上の正式名称）：研究所OA機器更改支援\n> □期間：（書面上での契約期間）：12/1－12/31　（1月１回　更新）\n> □作業場所：三鷹\n> □沿線/最寄駅：三鷹駅\n> □勤務時間：150－200\n> □作業範囲：設計書作成、開発、テスト\n> □月額単金：480,000円\n> □精算方法：時間幅：150H-200H\n> □超過単金：2,400円【200割り】＊1円未満（切捨て）\n> □控除単金:3,200円【150割り】＊1円未満（切捨て）\n> □調整単位：　30分\n> □支払条件：毎月末日締め翌々月15（45日サイト）\n> \n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n\"																\n																\n																\n																\n																\n','000004','2018-01-29 17:37:53','ApprDocEnt','000004','2018-01-29 17:37:53','Unknow'),(317,203,1,'On 2018/01/05 13:51, NASTec辻保孝 wrote:\n> ＴＳＲソリューションズ株式会社\n> 　須賀　様\n> \n> お世話になっております。ナステックの辻です。\n> \n> ご連絡有難う御座いました。\n> 入館証用写真の件につきましては、ご対応の程、\n> 宜しくお願い致します。\n> \n> また、お問い合わせ頂きました件につきまして、\n> 下記の通り、ご回答させて頂きます。\n> ご確認の程、宜しくお願い致します。\n> \n> また、月額単金の項目に「※1月度分については日割り」とありましたが、\n> 昨日（4日）お電話でお話しさせて頂きました通り、\n> 日割り精算ではなく、一人月で契約させて頂き、\n> 下限時間（140H）から実稼働時間の差分を控除することでお願い致します。\n> \n> その他ご不明点が御座いましたらお問い合わせください。','000001','2018-01-29 17:40:00','ApprDocEnt','000001','2018-01-29 17:40:00','Unknow'),(318,203,2,'> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> □要員氏名：堀　貴憲\n> □案件名：次期DCN及びコアNW構築支援業務\n> □期間：2018年1月15日～2018年3月31日\n> □入場日：2018年1月15日\n> □作業場所：東京都調布市入間町1-44　NTT中央研修センタ\n> □沿線/最寄駅：成城学園前\n> □作業範囲：次期DCN網及びコアネットワークに関する以下の作業\n> 　　　　　　・検証項目作成及び実施\n> 　　　　　　・上記に関連する各種ドキュメントの作成\n> 　　　　　　・その他、上記に関連した業務\n> □作業役割：メンバ\n> □月額単金（税抜）：￥520,000-\n> □精算方法：140-180H　上下割\n> □超過単金：\\2,800\n> □控除単金：\\3,700\n> □就業時間：9:00～17:30（休憩1時間）\n> □休憩時間：休憩1時間\n> □調整単位：30分\n> □契約形態：業務委託契約\n> □支払条件：月末締め　翌月末払い（金融機関休業日は翌営業日払い）\n> □商流：お客様→ナステック→TSRS\n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> \n> 以上\n> 宜しくお願い致します。','000001','2018-01-29 17:40:00','ApprDocEnt','000001','2018-01-29 17:40:00','Unknow'),(321,205,1,'\" 劉さん\n\nお世話になります。飯島です。\n下記案件概要になります。\n黄さんのフルネ－ム（漢字とフリガナ）を早めに頂けますでしょうか？\n\n【業務内容】公共システム製造～テスト案件業務(Java/Oracle)\n【勤務地】東京都千代田区神田神保町3-25 住友不動産住友神保町ビル\n【エンド】(株)日立システムズ\n【勤務時間】9～1730（12～1245）\n【勤務表】２種類（日立システム用＋請求確認用）\n※請求確認用は御社フォームで構いませんが一旦フォーム雛型を頂けます（メール）と助かります。\n\n【契約期間】７月６日（予定※調整中）～１２月末予定（原則１ヶ月単位）※７、８月については２ヶ月精算の可能性有\n【契約単価】４６万円（税抜）※７月は途中入場なので営業日割計算。\n【精算範囲】１４０～２００H※精算単価上下限時間割\n【定時内カウント単位】１５分単位\n【定時外カウント単位】３０分単位（17:30から17:45、19:00から19:30、21:30から21:45、23:45から0:15は休憩時間となりカウントされませんのでお気をつけください。）\n【備考】日本語コミュニケーションや業務スキルにて著しく業務支障が生じる場合は要員交代・終了も含め速やかに相談対応願います。\n【契約先】LEX(株)\n\n宜しくお願い致します。\n\"																\n																\n																\n																\n																\n','000001','2018-01-29 17:55:47','ApprDocEnt','000001','2018-01-29 17:55:47','Unknow'),(322,206,1,'\"On 2018/01/04 10:58, kyazawa@sysco.co.jp wrote:\n> TSRソリューションズ眞如様\n> \n> お世話になっております。\n> システムコーディネイト矢澤です。\n> \n> ご連絡ありがとうございます。\n> 内容承知いたしました。\n> 引き続きよろしくお願いいたします。\n> \n> \n> また、不足情報につきましてご連絡いたします。\n> \n>> -----------------------------------------------\n>> □案件名　：キャリア向けクラウド設計・構築 案件(PF)\n>> ■期間　　：平成30年1月10日～平成30年9月30日（3か月毎更新）\n>> □就業時間：10:00～19:00（昼休憩:12：00～13:00）\n>> ■時間単位：30分単位\n>> □作業内容：\n>> ・設計検討\n>> ・パラメータ設計またはPG設計\n>> ・構築または実装やコーディング\n>> ・作業手順書作成\n>> ・単体試験や結合試験\n>> ・事前検証実施\n>> ・現地作業統括（作業者指示/現場管理）\n>>\n>> ■作業場所：東京都中央区京橋１丁目１４−９\n>> □要員　　：村田　秀志（MTH(S)）契約社員\n>> □月額単金：700.000円（税抜）\n>> □精算方法：上下割　※稼働時間140-200H\n>>              超過単価：3,500円\n>>   　　　　　 控除単価：5,000円\n>> ■支払サイト：別途事務よりご連絡いたします。\n>> ■商流　　　：KDDI⇒ネットワンシステムズ⇒SYSCO⇒TSRS\n>> -----------------------------------------------\n> \n> 以上よろしくお願いいたします。\"																\n																\n																\n																\n																\n','000010','2018-01-29 17:57:55','ApprDocEnt','000010','2018-01-29 17:57:55','Unknow'),(323,207,1,'\"On 2017/12/19 16:59, \"\"システナ契約・支払・各種連絡\"\" wrote:\n> TSRソリューションズ株式会社　関根様\n> \n> 平素は大変お世話になっております。\n> 株式会社システナ パートナー推進グループの岩井でございます。\n> ご連絡が遅くなり申し訳ございません。\n> \n> この度は弊社業務へのご参画のご調整ありがとうございます。\n> 下記の内容にてご依頼致しますので、内容の確認をお願い致します\n\n> ---【入場について】-----------------------------------\n> \n> 日時：1月5日(金)　8:15\n> 場所：JR大船駅南改札前\n> 受入対応者：池田／090-9606-5061\n> \n> ※到着されましたら、受入対応者までご連絡をお願い致します。\n> \n> 持ち物\n> ①筆記用具\n> ②印鑑\n> ③証明写真2枚（H3cm×W2.5cm）\n> 　→着任申請書及び入構証（IDカード）添付用として使用します。\n> \n> その他\n> 当PJでは、以下の費用が定期的にかかります。\n>   \n> ①入構証発行手数料（1500円）＋証明写真撮影代金（入構証と申請書類添付用）\n> 　・半年更新です。半年毎に発生します。\n> \n> ②防災用品（ヘルメット＋巾着袋）\n> 　・一人ひとつ必要となります。\n> →ヘルメット（1200円）＋巾着袋（450円）＋送料（500円）＋税\n> \n> ※①、②の金額について、入場日当日にご本人様に一旦立て替えをお願いしております。\n> 領収書をお渡しさせて頂きますので、当月末の勤怠表を提出頂く際に一緒に提出頂き、\n> 翌月末にお振込みをさせて頂きます。\n> \n> ---【参画条件について】-------------------------------\n> \n> ※準委任契約でお願い致します。\n> ※弊社から個別注文書をご送付致します。\n> \n> 技術者氏名　：佐藤 正史（さとう　まさし）様\n> 雇用種別　　：貴社有期社員\n> 基本単価　　：650,000円／月　コア(150H～200H)\n> 時間精算　　：控除単価　基本単価　650,000円／150H→4,330円\n> 　　　　　　　超過単価　基本単価　650,000円／200H→3,250円\n> 清算幅　　　：30分単位、未満切り捨て\n> 契約期間　　：2018年1月5日～2018年1月31日\n> 案件名　　　：大船COBOL\n> ---------------------------------------------------\n> \n> それでは、引き続きシステナをよろしくお願い致します。\n> \n> 以上です。\n> \n> ━＊━━━━━━━━━━━━━━━━━━━━━━━━＊━\n>     株式会社システナ  本社\n>     〒105-0022 東京都港区海岸1丁目2番20号\n>     　 　 　 　 　 　 　 汐留ビルディング 14階\n> \n>     ◆ ソリューションデザイン本部　 　　TEL:03-6367-3842\n>     ◆ フレームワークデザイン本部　 　　TEL:03-6367-3848\n>     ◆ ITマネジメント事業本部　　　　　 TEL:03-6367-3858\n> …………………………………………………………………………\n>     株式会社システナ  横浜事業所\n>     〒220-8123 横浜市西区みなとみらい2丁目2番1号\n>      　 　 　 　 　 　 横浜ランドマークタワー23階\n> \n>     ◆ ソリューションデザイン本部 　　　TEL:045-640-1417\n>     ◆ パートナー推進室　　　　　 　　　TEL:045-640-1417\n> ━＊━━━━━━━━━━━━━━━━━━━━━━━━＊━\"																\n																\n																\n																\n																\n','000008','2018-01-29 18:11:18','ApprDocEnt','000008','2018-01-29 18:11:18','Unknow'),(324,207,2,'\"On 2017/12/27 10:43, \"\"システナ契約・支払・各種連絡\"\" wrote:\n> TSRソリューションズ株式会社　関根様\n> \n> 平素は大変お世話になっております。\n> 株式会社システナ パートナー推進グループの岩井でございます。\n> 先ほどはお忙しい所ご対応頂き、ありがとうございました。\n> \n> 佐藤様のご契約につきまして、お話させて頂きました通り\n> 3ヵ月でのご契約とさせて頂けますようお願いいたします。\n> \n> 変更前）契約期間 ：2018年1月1日～2018年1月31日\n> 変更後）契約期間 ：2018年1月1日～2018年3月31日\n> 　　　　※参画初日は1月5日となります。\n> \n> その