性あり\n> ・作業期間\n> 　　2018年1月4日-2018年3月31日☆\n> 　　※基本的には長期予定です。\n> ・就業時間\n> 　　9:00-18:00\n> ・入場日\n> 　　2018年1月4日☆\n> ・単価\n> 　　\\550,000-\n> ・精算幅\n> 　　固定\n> 　(高稼働になるようでしたら精算をつけれるよう交渉することになっておりま \n> す。)\n> ・お支払いサイト\n> 　　月末〆翌々月15日(45日後)\n> ------------------------------------------------------','000010','2018-02-02 20:24:02','ApprDocUpd','000010','2018-02-02 20:24:02','Unknow'),(700,115,1,'\"On 2016/12/07 11:17, \"\"システナ契約・請求・各種連絡\"\" wrote:\n> TSRソリューションズ株式会社　吉田様\n> 平素は大変お世話になっております。\n> システナ購買部の小高です。\n> この度は弊社業務へのご参画のご調整ありがとうございます。\n> 下記の内容にてご依頼致しますので、内容の確認をお願い致します。\n>---【確認事項と提出書類について】---------------------\n> ※本メールの返信にて翌営業日迄に必ずご回答ください。\n> １．参画条件：相違なし／相違あり（具体的に相違点を記載）\n> 　▼提出書類\n> 　　　見積書の作成をお願い致します。（データ不要、原紙のみ）\n> 　　　原本は後送する個別注文請書に同封で構いません。\n> ２．雇用種別：正社員／無期契約社員／有期契約社員\n> 　▼提出書類\n> 　　　添付の誓約書をご提出ください（PDFデータのみ、原紙不要）\n> 　　　本人署名・捺印後、原紙は所属会社で保管し、PDFデータを\n> 　　　本メールのご返信でご提出ください。\n> 　　（署名日付は業務参画前の日付）\n> ３．再委託　：有り／無し\n> 　＜再委託有りの場合＞\n> 　３－１．システナ以降の取引商流と\n> 　　　　　契約形態（派遣・準委任など）を記載してください。\n> 　　　　　例）システナ→貴社→（準委任）→所属会社\n> 　３－２．所属会社名を記載ください。\n> 　▼提出書類\n> 　　　再委託利用届をご提出ください。（データ不要、原紙のみ）\n> 　　　原本は後送する個別注文請書に同封で構いません。\n> ※　外国籍の方の場合、在留カード（または外国人登録証明書）の\n> 　　PDFデータ（カラー）の提出もお願いいたします。\n> ---------------------------------------------------\n> 【入場について】\n> ※当日は筆記用具、印鑑をお持ちください。\n> 日時：1月5日(木)　9:30\n> 場所：東京都港区海岸1-2-20　汐留ビルディング14階\n> 受入対応者：森下／購買部\n> ◎到着されましたら、携帯までご連絡をお願い致します。\n> ---------------------------------------------------\n> 【参画条件について】\n> ※準委任契約でお願い致します。\n> ※弊社から個別注文書をご送付致します。\n> 技術者氏名　：金田 俊（かねだ　しゅん）様\n> 雇用種別　　：貴社有期社員\n> 基本単価　　：600,000円／月　コア(140H～200H)\n> 時間精算　　：控除単価　基本単価　600,000円／140H→4,280円\n> 　　　　　　　超過単価　基本単価　600,000円／200H→3,000円\n> 清算幅　　　：30分単位、未満切り捨て\n> 契約期間　　：2017年1月5日～2016年1月31日\n> 案件名　　　：既存Webシステムの機能VerUp案件\n\"																\n																\n																\n																\n																\n','000008','2018-02-02 20:26:21','ApprDocUpd','000008','2018-02-02 20:26:21','Unknow'),(701,115,2,'\"募集案件名：Webシステム機能VerUp案件 \n\n案件概要　：既存WebシステムBI製品の2次開発を行う \n\n作業場所　：浜松町または西新宿 \n\n作業期間　：2016/12/1～2017/6/30 \n\n必須スキル：backbone.js経験のある方 \n　　　　　　アプリ開発経験がある方※Java、Javascript、lessまたはCSS、 \n　　　　　　HTML、JSPのいずれかのご経験 \n　　　　　　データフォーマット：JSON (JavaScript Object Notation)の理解がある方 \n　　　　　　Node.jsの理解がある方 \n\n任意スキル：テスト：Jasmine、Mocha等のユニットテスト経験 \n　　　　　　構成管理ツール：gitLab利用経験 \n　　　　　　方式設計実務経験者 \n　　　　　　DWH、BI製品自体の開発経験 \n　　　　　　PostgreSQL、インメモリーデータベースを使用した開発経験 \nSPA（シングルページアプリケーション）開発経験がある方 \nフレームワーク：BackboneJSを使用した開発の実務経験がある方 \nスタイルシートの経験がある方 \n　　　　　　インメモリデータベース自体の開発経験 \n\n募集人数　：2名 \n\n単金範囲　：ご提示ください（清算あり　※スキル見合い） \n\n年齢／性別：50歳程度まで／不問 \n\n所属先　　：貴社社員または契約社員／1社先様可／外国籍可 \n\n服装　　　：ビジネススーツ \n\n面談回数　：2回 \"														\n														\n														\n														\n														\n','000008','2018-02-02 20:26:21','ApprDocUpd','000008','2018-02-02 20:26:21','Unknow'),(702,46,1,'\"＜案件概要＞\n案件名：施工管理機能の新規追加\n内　容： 工事業者の組織体制図や、保険適用一覧などの 　　　　\n　　　　　帳票システムのリプレイス\nスキル： ・Javaでの設計～テストまでの経験\n　　　　　・内部設計に強い方歓迎\n　　　　　（尚可） 　　\n　　　　　・建築系業務経験\n場　所：横浜駅\n期　間：即日～長期\n単　金：スキル見合い\n精　算：140h-180h\n面　談：1回\n\n今後とも末永いお付き合いの程、何卒、よろしくお願い申し上げます。\n\"																\n																\n																\n																\n																\n','000004','2018-02-02 20:28:45','ApprDocUpd','000004','2018-02-02 20:28:45','Unknow'),(703,46,2,'\"TSRソリューションズ\n劉さま\n\nいつも大変お世話になっております。\n株式会社ユニバーサルコンツェルンの島田でございます。\n\nご連絡遅くなりまして大変申し訳ございません。\n下記条件詳細、入場詳細となります。\n\n単　価：500,000円\n精　算：140-180（上下割り）\n期　間：9/1～9/末（初回単月）\n\n日程：9月1日(金)9時45分\n場所：JR横浜駅西口交番前\n担当：後藤様(070-5083-4944)\n持物：筆記用具、御印鑑\n\nいつもありがとうございます。\n\n今後とも末永いお付き合いの程、何卒、よろしくお願い申し上げます。\n\"														\n														\n														\n														\n														\n','000004','2018-02-02 20:28:45','ApprDocUpd','000004','2018-02-02 20:28:45','Unknow'),(705,105,1,'\"眞如　様\n\n大変お世話になっております。\nＭＴＩの片山です。\n連絡が遅くなり申し訳ありません。\n下萩様の携帯番号を教えてください。\n\n相違点は■で表示しております。\n\n ■期間：注文書が来ておりませんので契約期間は判りません。\n　　　　問題が無ければ平成30年3月迄継続します。\n　　　　尚4月以降も対応をお願いしたいと言われているそうです。\n ■担当：メンバー？　　リーダー判りません\n ■月額単金：560,000円でお願いできませんか？\n ■精算方法：上下割　※稼働時間140-180H以内想定\n ■単価：140時間を下回った場合：4,000円/時間\n 　　　　180時間を超えた場合　：3,110円/時間\n\n【