文書のパスワードは別途連絡をさせていただきます。\n見積NO.：244723180200-6577-201710\n\"																\n																\n																\n																\n																\n','000008','2018-02-02 21:54:02','ApprDocUpd','000008','2018-02-02 21:54:02','Unknow'),(731,69,1,'\"On 2017/08/30 11:04, 樫山宏信 wrote:\n> TSRソリューションズ株式会社\n> 新井　典孝様\n> いつもお世話になっております。富士ソフトの樫山です。\n> 大変失礼しました、下記が間違っていましたので修正させてください。\n> ￥420,000.-×8　×　→ 420,000.- ×６\n> －－－－－－－－－－－－－－－－－－－－－－\n> ＜ 御見積金額 ＞\n> ￥3,039,120.-（税込）\n> （内訳 9月￥294,000.-　10月～18年3月の6か月￥420,000.- ×６　= ￥2,814,000.- + 消費税）\n> －－－－－－－－－－－－－－－－－－－－－－\n> よろしくお願いいたします。\n> 以上\n> 2017年8月30日 10:31 樫山宏信 <kasiyama@fsi.co.jp <mailto:kasiyama@fsi.co.jp>>:\n>     TSRソリューションズ株式会社\n>     新井　典孝様\n>     いつもお世話になっております。富士ソフトの樫山です。\n>     ご確認ありがとうございます。\n>     御見積書へ下記の内容をご記載の上、\n>     鈴木様の最新の経歴書と合わせてご提出をお願い致します。\n>     =======================================\n>     ＜ 契約形態 ＞\n>     派遣契約\n>     ＜ 作業要員名 ＞\n>     鈴木昭徳 様のお名前をフルネームでお願い致します。\n>     　※ 差し障りあるようでしたら、イニシャルでもかまいません。\n>     ＜ 就業期間 ＞\n>     2017 年 9 月 11 日　～　2018 年 3 月 31 日\n>     ＜ 基本契約条件 ＞\n>     下記メールの条件をお願い致します。\n>     ＜ 御見積金額 ＞\n>     ￥3,946,320.-\n>     　※ 消費税の記載を省かれる場合は、\n>     　　【税別】であることを明記してください。\n>     （内訳 9月￥294,000.-　10月～18年3月の6か月￥420,000.-×8　=\n>     ￥3,654,000.- + 消費税）\n>     ＜ お支払条件 ＞\n>     月末締め翌月末日支払\n>     ＜ 納入物件について ＞\n>     派遣契約の方の場合は、\n>     勤怠は弊社の WEB システムで入力していただきます。\n>     毎月定期的にご提出いただく納入物件はございませんので、\n>     納入物件の記載がございましたら、空欄としてください。\n>     =======================================\n>     事務手続きにつきましては、CCにあります、池沼が行いますので\n>     不明点等ありましたら、池沼まで確認をいただければと思います。\n>     よろしくお願いいたします。\n>     以上\"																\n																\n																\n																\n																\n','000010','2018-02-02 21:54:09','ApprDocUpd','000010','2018-02-02 21:54:09','Unknow'),(732,69,2,'\"\n    2017年8月29日 21:19 ＴＳＲソリューションズ株式会社案件\n    <anken@tsrs.co.jp <mailto:anken@tsrs.co.jp>>:\n        富士ソフト株式会社\n        ソリューション事業本部\n        インダストリービジネス事業部\n        制御アプリケーションシステム部\n        樫山　宏信　様\n        TSRソリューションズ株式会社\n        新井典孝\n        On 2017/08/29 20:57, 樫山宏信 wrote:\n            TSRソリューションズ株式会社\n            新井　典孝様\n            いつもお世話になっております。富士ソフトの樫山です。\n            手続きを進めさせていただくにあたり、条件につきましてお手数で\n            すがご確認お 願いいたします。\n            9月の途中入場(9/11～）になりますので、9月につきましては、日\n            割りで計算さ せていただきます。\n            －－－－－－－－－－－－－－－\n            ＜ 基本 契約条件 ＞\n            月　　額 ： ￥420,000\n            基準時間 ： 140 H　～　180 H\n            超過単金 ： ￥2,330/H\n            控除単金 ： ￥3,000/H\n            ＜ 2017 年 9 月度 契約条件 ･･･ 0.7人月（14／20実働日）＞　\n            月　　額 ： ￥294,000\n            基準時間 ： 98 H　～　126 H\n            －－－－－－－－－－－－－－－\n            基本契約条件として超過単金・控除単金と、9月度の契約条件につ\n            きまして\n            ご確認のほどお願いいたします。\n            よろしくお願いいたします。\n            以上 \"														\n														\n														\n														\n														\n','000010','2018-02-02 21:54:09','ApprDocUpd','000010','2018-02-02 21:54:09','Unknow'),(736,236,1,'見積書添付致します。','000008','2018-02-03 18:08:27','ApprDocEnt','000008','2018-02-03 18:08:27','Unknow'),(737,235,1,'見積書添付致します。','000008','2018-02-03 18:13:47','ApprDocUpd','000008','2018-02-03 18:13:47','Unknow'),(738,237,1,'\n> お世話になっております。\n> アトムシステムの伊東です。\n> \n> 先日お送りしました条件に追記して再送します。\n> \n> 【条件面】\n> □案件名　：MMCヘルプデスク（田町）\n> □期間　　：‪平成30年1月31日～平成30年2月28日‬\n> ※2,3月は単月契約でお願い致します。長期で延長予定。\n> □就業時間：8:45～17:45\n> □時間単位：15分単位\n> □作業内容：メール及び電話の英語対応、台帳管理、ドキュメント作成\n> □作業場所：‪田町駅‬より徒歩7分程度\n> □要員　　：西川  正裕(契約社員)\n> □月額単金：550,000円(税抜)\n> □精算方法：140-180（精算有）\n> 中間割　※稼働時間140-180H\n> 超過単価：3,430円\n> 控除単価：3,430円\n> □支払サイト：月末締め翌月末支払\n> □商流　　　：エンド→三菱電機→アトムシステム→TSRS\n> \n> また1月分（1/31）のお支払につきましては、\n> 2月度に合算請求でお願いしたく存じます。\n> 1月分単金は月額÷160H×8H＝27,500円でお願い致します。\n> \n> お忙しいところお手数ではございますが、\n> ご確認のほど宜しくお願い致します。\n> \n> \n> ┏┏┏┏┏┏┏┏┏┏┏┏┏┏┏┏┏┏┏\n>  　　株式会社アトムシステム\n>  　　　アウトソーシング営業部\n>  　　　　伊東　毅（Tsuyoki Itoh）\n>   　　Mobile  080-4838-1836\n>     　t-itoh@atomsystem.co.jp\n>  -------------------------------------','000008','2018-02-03 18:58:49','ApprDocEnt','000008','2018-02-03 18:58:49','Unknow'),(739,