ス増設やケーブル配線ができること\n　　　　[6]TeraternやWiresharkなどの検証ツールを使える\n　　　　[7]業務改善提案ができる\n　　　　[8]コミュニケーションスキル（報連相できる）\n【尚可】\n　　　　・キャリア様用ネットワーク技術に精通\n            （SIP、マルチキャスト、PPP、IPv6）\n　　　　・Linuxサーバーの構築、操作\n【若手 希望所持スキル】\n　　　　・TCP/IPやインターネットの仕組みが理解できている\n　　　　・上記 [3][6][8]の知識がある\n　　　　　※独学、研修でも可(今後学ぶ意欲のある方)\n■面談回数\n　　2回\n■備考\n　　・外国籍不可\n　　・御社まで\n　　・ネットワークの知識のある方でしたら未経験でも可\n　　・有識者+若手のセット提案が望ましいですが、\n　　 若手のみ、有識者のみのご紹介もご相談ください。\n\n\n\"														\n														\n														\n														\n														\n','000010','2018-02-05 17:33:56','ApprDocUpd','000010','2018-02-05 17:33:56','Unknow'),(767,164,1,'\"On 2017/07/13 14:43, 奥玉　直宏 wrote:\n> 須賀さま\n> \n> お世話になっております。\n> 8月～井口様参画、宜しくお願いいたします。\n> \n> 稼働は現在のところ安定しており稼働状況は良好です。\n> また、今回の商流は、\n> 元請け→日本オーエー研究所→テクノエージェント→弊社と\n> なりますが、弊社も日本オーエー研究所と口座があり、\n> 本プロジェクトのテストチームのPMOとして弊社社員も長期で\n> 入っていますので、ご安心下さい。\n> \n> 今回、口頭でお話ししました契約内容をエビデンスとしましたので\n> ご確認頂き、お約束通りでしたら、了承の旨、お返事頂けますと\n> 幸甚です。\n> \n> また、お見積書の発行もお願いいたします。\n> \n> 宜しくお願いいたします。\"																\n																\n																\n																\n																\n','000010','2018-02-05 17:36:54','ApprDocUpd','000010','2018-02-05 17:36:54','Unknow'),(768,164,2,'\"１．契約形態　　　　：SES\n２．契約期間　　　　：2017年8月1日 ～ 2017年9月30日\n※長期になりますが、契約は次回より3か月更新。\n３．案件名　　　　　：国税システム（ＤＢサブシステム）の業務開発\n４．作業場所　　　　：朝霞\n５．単価の算定条件\n　　月額単価　　　　：520,000円\n　　基準時間　　　　：140-190\n６．報酬の算定条件\n　　加算単価  ：2,730円（10円未満切り捨て）\n　　控除単価  ：3,710円（10円未満切り捨て）\n　　\n　　作業時間の単位　：日々　　30分単位\n　　　　　　　　　　　月間　　30分単位\n７．一日の基準時間  ：7時間30分　\n  定時  ：　 9時　30分　～　  18時　00分\n  昼休憩  ：　12時　00分　　～　13時　00分\n  夕方休憩           ：　なし\n  その他休憩  ：　なし\n  ８．勤務表、請求書、見積書の取扱\n弊社(ESP)の勤務表の受取方法　　　：御社よりPDFにて　k-honbu@esprit-fort.co.jp　にお送り頂く\n\n御社（TSR様）の勤務表受取方法：客先フォーマットの勤務表を技術者様より入手頂く\n請求書の提出期限　：末日締め翌月第３営業日原本必着\n請求書送付先　　　：〒550-0002　大阪府大阪市西区江戸堀2-2-1アズワン別館8F\n　　　　　　　　　　　　管理本部宛　k-honbu@esprit-fort.co.jp\n  　　 電話 06-6459-0901 Fax 06-6459-0902\n\n見積書送付先　　　：請求書の送付先と（同様）\n\n\n９．交通費の支払　　　　：無（契約金額に含む）\n　　　                    但し、現場指示による移動の場合は別途請求となります。\n\"														\n														\n