9：00～18：00\n> □作業範囲：開示システム業務運用作業\n> □担当：業務運用担当\n> □月額単金：500,000円\n> □精算方法：時間幅140h-180h\n> □超過単金：2,770円【180割り】＊1円未満（切捨て）\n> □控除単金：3,570円【140割り】＊1円未満（切捨て）\n> □調整単位：15分\n> □支払条件：毎月末日締め翌月末日支払い（30日サイト）\n\"																\n																\n																\n																\n																\n','000003','2018-02-05 21:58:31','ApprDocUpd','000003','2018-02-05 21:58:31','Unknow'),(827,116,1,'見積書を添付いたします。','000003','2018-02-05 22:05:28','ApprDocUpd','000003','2018-02-05 22:05:28','Unknow'),(829,98,1,'\"■業務内容\n某信託銀行において、基幹システムに組み込むには費用対効果が得られにくい、ニーズに対して、主にExcelVBA，AccessVBAを用いてシステムの開発を\n　　行っています。構築したシステムの位置づけは基幹システムに準ずる重要システムとして扱われる為、一般的なEUCとは区別して管理されています。\n<構築システムの一例>\n・議決権管理システム　　　・401K信託報酬管理システム　・大量保有報告管理システム　・支払調書作成ツール　など\n■募集要項\n募集にあたり、以下を条件としています。\n・言語はVBAを利用しますが、システムの取扱および開発工程(品質基準)は基幹システムと同等のため、ウォーターフォール型の開発経験を求む。\n・簡易EUC開発のみ経験の方は不可。・常駐保守開発チームに参画いただくため、長期での就業が可能な方。・コミュニケーションが円滑にとれる方\n\n\"																\n																\n																\n																\n																\n','000003','2018-02-05 22:08:04','ApprDocUpd','000003','2018-02-05 22:08:04','Unknow'),(830,64,1,'\"On 2017/07/21 16:43, 大河原 香 wrote:\n> TSRソリューションズ株式会社\n> 吉田様\n> \n> お世話になっております。\n> ハイマックス大河原でございます。\n> \n> 大森様の精算条件は以下になります。\n> \n> 月額　：　\\680,000-　（140H～200H）\n> 控除金額　：　\\4,857-\n> 超過金額　：　\\3,400-\n> \n> \n> 支払いについては下記になります。\n> \n> 検収締切日：毎月末日。作業実績表により即日検収。\n> 支払日：本体価格は翌月末日。精算差額、旅費は翌月20日。\n> 　　　　　但し、マイナスの精算差額は翌月末日。帰社指定の銀行口座へ振込。\n> \n> \n>>> ≪案件内容≫\n>>> 件　　名：TFX次期開発\n>>> 期　　間：2017年8月1日～2017年9月30日\n>>> 作業場所：門前仲町\n>>> 見積範囲：大森　次郎 様　計1名\"																\n																\n																\n																\n																\n','000003','2018-02-05 22:10:25','ApprDocUpd','000003','2018-02-05 22:10:25','Unknow'),(833,52,1,'別紙顧客へ提出済みの御見積書を添付いたします。','000003','2018-02-05 22:16:42','ApprDocUpd','000003','2018-02-05 22:16:42','Unknow'),(834,154,1,'\"ＴＳＲソリューションズ㈱ 戸川様\n\nお世話になっております。\nDTS泉谷です。\n\nばらばらとすみません。\n調整単位については15分とさせていただきたいのですが\n問題ないでしょうか。\n\n以上ご確認よろしくお願い致します。\nOn Fri, 15 Sep 2017 19:50:54 +0900\n泉谷　真