っております。\nハイマックス滝川です。\n\nこちらこそ、なかなか決まらずにご迷惑をおかけしてしまいました。\nご協力いただき、ありがとうございました。\n\n条件について回答いたします。\n\nよろしくお願いいたします。\n\n□契約形態：派遣\n■案件名（書面上の正式名称）：資産運用事務改善\n■期間：（書面上での契約期間）2017年8月16日～\n□作業場所：東京都千代田区丸の内2-1-1\n□沿線/最寄駅：二重橋駅\n□勤務時間：9:30～17:30\n■作業範囲：PMO\n■担当：PMO\n□月額単金：850,000円\n□精算方法：時間幅140h-2000h\n□超過単金：4,250円【200割り】＊1円未満（切捨て）\n□控除単金：6,070円【140割り】＊1円未満（切捨て）\n□調整単位：30分\n□支払条件：毎月末日締め翌月末日支払い（30日サイト）\n□8月の精算方法：日割按分精算とします。\n12日（稼働日）÷22日（営業日）＝ 0.55人月\n850,000円　×　0.55人月　＝　467,500円\n基準時間：77H-110H　調整単価:変更なし\"																\n																\n																\n																\n																\n','000003','2018-02-05 22:41:45','ApprDocUpd','000003','2018-02-05 22:41:45','Unknow'),(844,66,1,'\"【御見積り内容】\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n□エンジニア名：森山　利和　（モリヤマ　トシカズ）\n□案件名：空港系開発案件\n□期間：2017年11月8日～2017年11月30日\n　※契約は1ヶ月単位でお願いいたします。\n□作業場所：貴社内\n（神奈川県横浜市西区みなとみらい2-3-5　クイーンズタワーC棟 16階）\n　※お客様の現場が川崎市殿町(バス30分)にあり、打ち合わせ、または\n　　テスト実施のために行くことがありますので、ご了承ください。\n　　基本的にはみなみとみらいになります。\n□沿線/最寄駅：みなとみらい駅\n□勤務時間：9:30～18:30\n□作業範囲：プロジェクト管理\n□担当：ＰＭＯ\n□月額単金：750,000円\n□精算方法：時間幅140h-200h\n□超過単金：3,750円【200割り】＊1円未満（切捨て）\n□控除単金：5,350円【140割り】＊1円未満（切捨て）\n□調整単位：30分\n□支払条件：末締め、翌月末支払（30日）\n□11月の精算\n11月8日～11月30日　実稼動/16日  想定稼動/20日稼動\n16日/20日（0.8人月) ＝　750,000円　× 0.8人月 = 600,000円\n精算幅 : 112H - 160H\n\"																\n																\n																\n																\n																\n','000003','2018-02-05 22:42:08','ApprDocUpd','000003','2018-02-05 22:42:08','Unknow'),(845,73,1,'\"ＴＳＲソリューションズ株式会社\n戸川　浩一　様\n\nお世話になります。小原＠ＴＳＳでございます。\n昨日は案件説明会の対応、ありがとうございました。\n現場から参画依頼がありましたので、ご本人への確認を\nお願い致します。\nお客様との調整に以下が必要となりますので、内容も含め\n連携をお願い致します。\n\n技術者様：大内（フルネーム・読み仮名）　※至急連携下さい\n参画可能日：5/25（木）最短の場合。※至急連携下さい\n契約形態：弊社への派遣契約\n契約金額：5月～7月　70万（基本固定）\n　　　　　8月以降については、ご希望金額（73万）について実績評価を\n　　　　　踏まえて調整する。\n　　　　　5月　5日（稼動予定）/20日（営業日）=0.25人月\n　　　　　0.25人月　×　70万　=　175,000円\n\"																\n																\n																\n																\n																\n','000003','2018-02-05 22:47:02','ApprDocUpd','000003','2018-02-05 22:47:02','Unknow'),(846,62,1,'\"On 2017/06/22 16:07, 村井 仁 wrote:\n>\n> TSRソリューション\n> 玉川 様\n>\n> いつも大変お世話になっております。\n> AZURE・PLUS(株)の村井です。\n>\n> OMY(K)様の件はご調整有難うございました。\n> 下記条件で御見積書を頂戴出来ますでしょうか？\n> ご対応の程宜しくお願いいたします。\n>\n>\n> 案件名；帳票作成システム開発案件\n> 期間；７月１日～１２月３１日\n> 金額；６２万／月\n> 精算；月間実働時間１４０ｈ未満、または１８０ｈ超過時\n> 精算条件；￥３,８７５／ｈ（１６０割、１０円未満切り捨て）\n> 精算単位；３０分毎\n> 就業先；神保町\n> お支払い債渡；毎月末締、翌々月１０日支払い\n>\n>\n> 以上、何卒宜しくお願い申し上げます。 \"																\n																\n																\n																\n																\n','000003','2018-02-05 22:47:25','ApprDocUpd','000003','2018-02-05 22:47:25','Unknow'),(847,148,1,'\"ＴＳＲソリューションズ株式会社\n戸川　浩一　様\n\nお世話になります。小原＠ＴＳＳでございます。\n昨日は案件説明会の対応、ありがとうございました。\n現場から参画依頼がありましたので、ご本人への確認を\nお願い致します。\nお客様との調整に以下が必要となりますので、内容も含め\n連携をお願い致します。\n\n技術者様：大内（フルネーム・読み仮名）　※至急連携下さい\n参画可能日：5/25（木）最短の場合。※至急連携下さい\n契約形態：弊社への派遣契約\n契約金額：5月～7月　70万（基本固定）\n　　　　　8月以降については、ご希望金額（73万）について実績評価を\n　　　　　踏まえて調整する。\n　　　　　5月　5日（稼動予定）/20日（営業日）=0.25人月\n　　　　　0.25人月　×　70万　=　175,000円\n\"																\n																\n																\n																\n																\n','000003','2018-02-05 22:49:59','ApprDocUpd','000003','2018-02-05 22:49:59','Unknow'),(850,106,1,'','000003','2018-02-06 10:59:48','ApprDocUpd','000003','2018-02-06 10:59:48','Unknow'),(851,220,1,'\"■業務内容\n某信託銀行において、基幹システムに組み込むには費用対効果が得られにくい、ニーズに対して、主にExcelVBA，AccessVBAを用いてシステムの開発を\n　　行っています。構築したシステムの位置づけは基幹システムに準ずる重要システムとして扱われる為、一般的なEUCとは区別して管理されています。\n<構築システムの一例>\n・議決権管理システム　　　・401K信託報酬管理システム　・大量保有報告管理システム　・支払調書作成ツール　など\n■募集要項\n募集にあたり、以下を条件としています。\n・言語はVBAを利用しますが、システムの取扱および開発工程(品質基準)は基幹システムと同等のため、ウォーターフォール型の開発経験を求む。\n・簡易EUC開発のみ経験の方は不可。・常駐保守開発チームに参画いただくため、長期での就業が可能な方。・コミュニケーションが円滑にとれる方\n\n\"																\n																\n																\n																\n																\n','000007','2018-02-06 14:57:49','ApprDocUpd','000007','2018-02-06 14:57:49','Unknow'),(852,217,1,'\"\nOn 2016/03/31 15:17, 杉浦【ユニインフォーメーション】 wrote:\n> TSRソリューションズ\n> 吉田様\n> \n> いつも大変お世話になっております\n> ユニインフォーメーションの杉浦です\n> \n> 岡野様の月額単金は4月1日分より変更となり\n> それに伴います条件は以下となりますので\n> 宜しくお願い致します。\n> \n> -----------------------\n> \\640,000.-（月額単価）\n> ※変更（20,000UP)\n> \n> 精算（150h-200h）\n> ※時間の変更は有りませんが\n> 精算時間単価の計算は下記に変更です。\n> \n> ・控除時間単価@4,260.-\n> ・超過時間単価@3,200.-\n> \n> その他の条件変更はございません。━\"																\n																\n																\n																\n																\n','000005','2018-02-06 19:02:12','ApprDocUpd','000005','2018-02-06 19:02:12','Unknow'),(853,215,1,'','000005','2018-02-06 19:03:21','ApprDocUpd','000005','2018-02-06 19:03:21','Unknow'),(854,211,1,'\"\nOn 2017/08/18 12:06, isobe yukihiro wrote:\n> 吉田様\n> \n> お世話様です。\n> 遅くなりすみません。\n> \n> ＞＞＞\n> 案件名： お客様マイページ（2017年度機能強化Vol1）支援\n> 作業内容： テスト作業\n> 現場最寄り駅：東陽町\n> 期間：8/21～9/30\n> 単価：42万\n> 精算：160～200\n> 支払いサイト：55日\n> ＞＞＞\n> \n> ご確認お願いします。\n> \n> よろしくお願いします。\n> \n> 磯部\"																\n																\n																\n																\n																\n','000005','2018-02-06 19:06:03','ApprDocUpd','000005','2018-02-06 19:06:03','Unknow'),(855,200,1,'\"\nOn 2017/01/13 16:27, 島田龍成 wrote:\n> TSRソリューションズ\n> 吉田様\n>\n> いつも大変お世話になっております。\n> 株式会社ユニバーサルコンツェルンの島田でございます。\n>\n> ご連絡いただきまして誠にありがとうございます。\n> 下記返信させていただきます。\n>\n> 引き続き何卒よろしくお願い申し上げます。\n>\n> □案件名（書面上の正式名称）：某メガキャリア向け会員システム保守開発対応\n> □期間：2017/1/30～2017/3/31\n> □作業場所：天王洲アイル\n> □入場日：2017/1/30\n> □沿線/最寄駅：東京モノレール　天王洲アイル\n> □作業範囲：開発、テスト\n> □作業担当：SPG\n> □月額単金（税抜）：640,000円\n> □精算方法：時間幅150h-200h\n> □超過単金：3,000円【200割り】＊10円未満（切捨て）\n> □控除単金：4,260円【140割り】＊10円未満（切捨て）\n> □就業時間：10:00～19:00\n> □調整単位：30分\n> □契約形態：準委任\n> □支払条件：毎月末日締め翌月末日支払い（45日サイト） \n\"																\n																\n																\n																\n																\n','000005','2018-02-06 19:08:29','ApprDocUpd','000005','2018-02-06 19:08:29','Unknow'),(856,197,1,'\"【案件概要】\n□案件名：横浜市介護保険システム（資格・給付）\n□期間：初回、一か月、以降は３ヶ月\n□入場日： ９月１日\n□作業場所：日本大通駅　日土地山下町ビル６階、（立会等の場合、地下鉄舞岡駅　㈱アイネット３階）　\n□沿線/最寄駅：（主）日本大通駅、横浜市営地下鉄／舞岡\n□作業範囲： 介護保険システム保守開発、設計～IT　開発言語：ＣＯＢＯＬ　ＯＳ：ＭＳＰ\n□担当：木村　※営業担当：古屋\n□月額単金（税抜）：５６０，０００\n□精算方法：１５０ｈ～１９０ｈ\n□超過単金：４，０００\n□控除単金：３，１５０\n□就業時間：９：００～１７：３０\n□休憩時間：１２：００～１３：００　昼休み\n□調整単位：30分\n□契約形態：派遣契約\n□支払条件：４９日\n\n2016/08/05 16:40\"																\n																\n																\n																\n																\n','000005','2018-02-06 19:13:45','ApprDocUpd','000005','2018-02-06 19:13:45','Unknow'),(857,196,1,'','000005','2018-02-06 19:14:47','ApprDocUpd','000005','2018-02-06 19:14:47','Unknow'),(858,194,1,'','000005','2018-02-06 19:15:51','ApprDocUpd','000005','2018-02-06 19:15:51','Unknow'),(859,35,1,'','000005','2018-02-06 19:20:43','ApprDocUpd','000005','2018-02-06 19:20:43','Unknow'),(860,180,1,'TSRソリューションズ株式会社\n 田口　麻衣子様\n\nいつも大変お世話になっております。\nSky株式会社の内海でございます。\n\n島田様のご契約詳細は下記の通りです。\nご確認の程、宜しくお願い致します。\n\n※基本契約書に関して、2016年3月31日で締結させて頂きます。\n※雇用保険被保険者証の控えを本メールへご返信ください。\n\n　・期間：2016年04月01日～2016年06月30日\n　※7月以降に関しては、5月末までにご連絡させて頂きます。\n　・作業場所：パイオニア 川越事業所\n　・ご単金：\\4,500/1h\n　※小数点以下は切り捨てさせて頂きます.\n　・清算単位：15分\n　・締め支払い：毎月末日締め、翌々月5日支払い\n\n初日の入場方法については、別途ご連絡させて頂きます。\n\n以上、何卒宜しくお願い致します。','000005','2018-02-06 19:21:59','ApprDocUpd','000005','2018-02-06 19:21:59','Unknow'),(861,180,2,'【T社17CY開発業務のプロジェクトリーダ業務】\n・オフショア先の管理\n　オフショア先(中国)のPLと連絡を取りながら、プロジェクト\n　全体の推進を図る。\n\n・バグトラッキング\n　バグの発生状況、評価の進捗を見ながら、SAバグ0、バグ0の\n　マイルストーンに向けての収束状況を把握、コントロールする\n\n・機材管理\n　開発に使用する機材の管理・調整、配布\n\n・開発環境検討\n　マスターデータ管理、組み合わせるソフトの検討等\n　\n・他部署との調整\n　設計、生産技術、生産管理との各種調整','000005','2018-02-06 19:21:59','ApprDocUpd','000005','2018-02-06 19:21:59','Unknow'),(862,48,1,'\"■案件名　：情報システムチームにおけるPCキッティング・セットアップ（仮） \n\n■技術者名：柿沼　秀典　様\n\n■場所　　：東武東上線 志木駅（市営バス 5分）\n　　　　　　 又は 武蔵野線 新座駅（無料バス 5分）\n \n■期間　　：9月1日～12月末 \n\n■単金　　：44万\n\n■精算　　：150～200ｈ\n　　　　　　　超過単価　＠2200\n　　　　　　　控除単価　＠2930\n\n■支払ｻｲﾄ ：月末締め翌々月15日\n8/25　10：07\"																\n																\n																\n																\n																\n','000005','2018-02-06 19:22:45','ApprDocUpd','000005','2018-02-06 19:22:45','Unknow'),(863,53,1,'\"On 2016/11/24 13:50, 篠崎 岳彦 wrote:\n> 中村様\n> \n> お世話になっております。ブレーンネットの篠崎です。\n> \n> ご連絡頂戴いたしました諸条件につきまして、\n> 以下に回答させていただきます。\n> \n> □案件名：移動体通信基地局建設に伴う管理業務支援\n> □期間：2016年12月19日～2017年3月31日\n> □入場日：2016年12月19日\n> □作業場所：八街市八街及び客先指定による\n> □沿線/最寄駅：JR八街駅\n> □作業範囲：以前のメールの通り\n> □担当：作業員\n> □月額単金：430,000円\n> □精算方法：時間幅140h-200時間\n> □超過単金：2,150円【200割り】＊1円未満（切捨て）\n> □控除単金：3,071円【140割り】＊1円未満（切捨て）\n> □就業時間：8時30分〜17時30分\n> □休憩時間：8時30分〜17時30分\n> □調整単位：15分単位/日、30分単位/月\n> □契約形態：業務委託契約\n> □支払条件：毎月末日締め翌々月15日支払い（45日サイト）\n> □4月の精算方法：日割按分精算とします。\n> 　【2016年12月19日～12月31日の精算方法】\n> 　\\430,000円×7日(稼動予定日)/19日(12月営業日数)＝158,421円\n> 　基準時間：51.5時間-73.5時間\n> \n> 遅くなり申し訳ございませんが、\n> ご確認の程、よろしくお願いいたします。\n> \n> 内容確認いただき、問題無いようでしたら社内処理完了後、\n> 契約書を送付させていただきます。\n> \n> 以上、よろしくお願い申し上げます。\"																\n																\n																\n																\n																\n','000005','2018-02-06 19:24:04','ApprDocUpd','000005','2018-02-06 19:24:04','Unknow'),(864,53,2,'\"On 2016/11/09 19:20, 篠崎 岳彦 wrote:\n> TSRソリューションズ株式会社\n> 中村 様、吉田 様\n> \n> いつも大変お世話になっております。\n> 株式会社ブレーンネット篠崎です。\n> \n> 弊社大川宛にご紹介いただいておりますSKY（H）様ですが、\n> 以下案件はご対応可能でしょうか？\n> ---------------------------------------------------------------\n> 案件概要：基地局建設工事に伴う各種管理、現場立ち合い等\n> \n> 【着工前準備】\n> 各種図面の確認、チェック\n> 施工計画書、切り替え手順書の作成・提出\n> 着工打合せ、工程確認、オーナー打ち合わせ\n> 無線機調整班（ベンダー）との日程調整・打合わせ（リプレイス作業） 　他\n> \n> 【施工中及び工程内調整】\n> 回線開通日の調整\n> コンサル指定業者との調整・打合わせ 、検査の調整・立会\n> 重要工程の立ち合い\n> （着工日、切替、停電作業、鉄塔建方、コンサル中間検査、完工日） 　他\n> ・竣工検査（完工日等で調整）\n> ・建設廃材搬出の調整・手配\n> \n> 【完工後】\n> 行政検査（コンサル検査） 、オーナーへの報告書の作成（主にビル局）\n> 完成図書等の作成\n> 設備照合チェック表との照合・提出 、設備共用の報告書\n> その他完工時報告書の提出\n> \n> 期間：即日～\n> \n> 場所：八街駅より徒歩圏内\"														\n														\n														\n														\n														\n','000005','2018-02-06 19:24:04','ApprDocUpd','000005','2018-02-06 19:24:04','Unknow'),(866,79,1,'\"On 2017/12/07 14:57, 岡田　庄司 wrote:\n> 須賀様\n> \n> お世話になっております。\n> PSの岡田です。\n> \n> ご返信が遅くなり、申し訳ございません。\n> 以下、ご確認ください。\n> \n> ＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n> □案件名（書面上の正式名称）：ECサイト開発　PMO業務\n> □期間（書面上での契約期間）：平成29年12月~平成30年1月末\n> □入場日：12月4日（月）\n> □作業場所：豊洲\n> □沿線/最寄駅：豊洲駅\n> □作業範囲：ECサイト開発に伴うPMO業務\n> 　　　　　　・問題・課題管理\n> 　　　　　　・WBS作成/管理\n> 　　　　　　・作業進捗確認\n> 　　　　　　・会議調整/資料作成\n> 　　　　　　・調整業務\n> 　　　　　　・内部報告/資料作成\n> 　　　　　　・その他PMO担当に