\n> \n> お世話になります。\n> 荒堀です。\n> 精算ですが、減額は、稼働日数×７です。\n> すいませんがよろしくお願いします。\n> \n> 【例】\n> 　２０日稼働とすると\n> \n> 超過　２０日×８日×1.25＝２００Ｈ\n> 控除　２０日×７＝１４０Ｈ\n> となります。\n> \n> よろしくお願いします。','000005','2018-02-06 19:49:36','ApprDocUpd','000005','2018-02-06 19:49:36','Unknow'),(880,134,1,'\"　　　　　ただし、次回より3か月単位での発注予定\n\n□作業場所：東京都江東区豊洲３－２－２０豊洲フロントビル\n□沿線/最寄駅：有楽町線　豊洲駅\n□勤務時間：9：00～18：00\n□作業範囲：Web基盤技術支援\n□担当：Web基盤運用\n□月額単金：750,000円\n□精算方法：時間幅150h-200h　（※175割り）\n□超過単金：4200円(100円未満切捨て)\n□控除単金：4200円(100円未満切捨て)\n□調整単位：15分\n□支払条件：毎月末日締め翌月末日支払い（30日サイト）\n□6月の精算方法：6/1からの参画なので1.0人月\n\n以下追記\n□該当者：御前　俊輔\n□JIEC現場指揮者：基盤エンジニアリング事業部　第１システム部 リーダー　竹中朋宏\n□JIEC現場指揮者連絡先：090-9680-3855\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n以上、よろしくお願いいたします。\n==========================================================\n株式会社JIEC\n総務部BP協業Gr　唯木　希 （Tadaki Nozomi)\n\n〒160-0023　東京都新宿区西新宿6-24-1\n西新宿三井ビルディング20Ｆ\ntel：03-5326-3652　　fax：03-5326-3653\nURL: http://www.jiec.co.jp\n==========================================================\"																\n																\n																\n																\n																\n','000005','2018-02-06 19:50:43','ApprDocUpd','000005','2018-02-06 19:50:43','Unknow'),(881,133,1,'受信日：Mon, 27 Jun 2016 17:33:43 \n\nＴＳＲソリューションズ戸川様\nいつもお世話になっております、コムチュア芳賀です。\n\n7月より下記条件でお願いします。\n\n□案件名（書面上の正式名称）：新情報システム改修\n□期間：（書面上での契約期間）2016/7/1～7/31（一旦一ヶ月契約とさせてください。少なくとも8月は継続でお願いする予定です。）\n□作業場所：みずほ情報総研 千石事業所 \n□沿線/最寄駅：都営三田線千石\n□勤務時間：9:00～17:30\n□作業範囲：設計～テスト\n□担当：山野　健一様\n□月額単金：63万\n□精算方法：精算あり（140～190）\n□超過単金：3700円（170基準）\n□控除単金：3700円（170基準）\n□調整単位：15分単位\n□支払条件：40日\n\n以上、今後とも何卒宜しくお願いいたします。','000005','2018-02-06 19:51:57','ApprDocUpd','000005','2018-02-06 19:51:57','Unknow'),(882,127,1,'','000005','2018-02-06 19:53:39','ApprDocUpd','000005','2018-02-06 19:53:39','Unknow'),(883,123,1,'','000005','2018-02-06 19:54:33','ApprDocUpd','000005','2018-02-06 19:54:33','Unknow'),(884,122,1,'\"受信日：Wed, 8 Mar 2017 01:18:02 +0900\n\n\nＴＳＲソリューションズ 戸川様\n\nお世話になっております、コムチュア松村です。\n御社稟議申請に必要な情報として、以下返答させて頂きます。\n\n＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝＝\n□案件名（書面上の正式名称）：ライブラリ